import PropTypes from 'prop-types'

const Header = ({props}) => {
    return (
        <header>
            <h1>{props.title}</h1>
        </header>
    )
}
Header.defaultProps = {
    title: 'Task Tracker',
}

Header.PropTypes = {
    title: PropTypes.string,
}

export default Header
